func (l *Log) OutputHTML(data config.OutputData) {
	if *l.Once {
		file, err := os.OpenFile(l.Conf.Output, os.O_CREATE|os.O_TRUNC|os.O_RDWR, 0777)
		if err != nil {
			l.Println(err)
			return
		}
		_, err = file.WriteString(template)
		if err != nil {
			l.Println(err)
			file.Close()
			return
		}
		file.Close()
		*l.Once = false
	}
	if data.Image == "" {
		data.Image = "data:image/jpg;base64,"
	}
	marshal, err := json.Marshal(data)
	if err != nil {
		l.Println(err)
		return
	}
	template = `<script class='web-vulns'>webVulns.push(` + string(marshal) + `)</script>`
	file, err := os.OpenFile(l.Conf.Output, os.O_WRONLY|os.O_APPEND, 0777)
	if err != nil {
		l.Println(err)
		return
	}
	_, err = file.WriteString(template)
	if err != nil {
		file.Close()
		l.Println(err)
		return
	}
	file.Close()
	l.percentage()
}

func (l *Log) Bar() {
	for {
		percentage := math.Trunc((((*l.Percentage)/l.AllHTTP)*100)*1e2) * 1e-2
		fmt.Printf("\r %s: %.2f%% %s: %s %s: %.2fs", aurora.BrightWhite("Percentage").String(), percentage, aurora.BrightWhite("Output").String(), l.Conf.Output, aurora.BrightWhite("Time").String(), time.Now().Sub(l.StartTime).Seconds())
		time.Sleep(1 * time.Second / 10)
	}
}

func (l *Log) percentage() {
	percentage := math.Trunc((((*l.Percentage)/l.AllHTTP)*100)*1e2) * 1e-2
	fmt.Printf("\r %s: %.2f%% %s: %s %s: %.2fs", aurora.BrightWhite("Percentage").String(), percentage, aurora.BrightWhite("Output").String(), l.Conf.Output, aurora.BrightWhite("Time").String(), time.Now().Sub(l.StartTime).Seconds())
}

func (l *Log) PercentageAdd() {
	l.PerLock.Lock()
	defer l.PerLock.Unlock()
	*l.Percentage++
	l.percentage()
}
